
import Vue from 'vue'
import VueRouter from 'vue-router'
Vue.use(VueRouter)
import VueNavbar from 'vue-navbar'
Vue.use(VueNavbar)
import App from './App.vue'

import Navdemo from './components/Navdemo.vue'

const routes = [
  { path: '/', component: Navdemo },
]

const router = new VueRouter({
  routes
})

new Vue({
  router,
  el: '#app',
  template: '<App/>',
  components: {
    App
  }
})